version = 1
requires-python = ">=3.10"
resolution-markers = [
    "python_full_version < '3.11' and sys_platform == 'darwin'",
    "python_full_version >= '3.11' and sys_platform == 'darwin'",
    "python_full_version < '3.11' and sys_platform == 'linux'",
    "python_full_version >= '3.11' and sys_platform == 'linux'",
